import React from 'react';

import "./wave.css"

const Wave = () => {
    return (
		<div class="audiobox"><h1>CSS Waves</h1>
			<div class="wave one"></div>
			<div class="wave two"></div>
			<div class="wave three"></div>
		</div>
    );
};

export default Wave;
